Atividades implementadas:
* Tela de cadastro de animal;
* Endpoint de cadastro de animal;
* Tela de busca por mapa;
* Endpoint de busca de animal;
* Widget de item de animal no resultado da busca;
* Tela com resultados de busca (por lista);
* Tela de visualizar animal;
* Endpoint de requisitar informações de um animal pelo ID.

Configuração inicial do projeto Flutter:
* Criação do projeto;
* Definição de cores globais;
* Definição de fonte.

Configuração inicial do projeto Node.js:
* Criação do projeto;
* Definição das dependências iniciais.

Implementar endpoint para tornar um animal exibido publicamente como adotado para que não seja mais exibido nas buscas do app. 
Inclui:
* Alterações na entidade animal para a inserção de um novo atributo para indicar se o animal foi ou não adotado;
* Alterações no endpoint de cadastro de animal para considerar este novo atributo;
* Alterações na classe modelo do app;
* Alterações no endpoint de busca para a criação de um novo filtro.
